/****************************************************************************
 * function 명 : lfn_Prprt_save
 * 내용        : 인수심사 승인 저장.
 ****************************************************************************/
scwin.lfn_save = function() {

    if (!scwin.lfn_Check_Validation()) {
        return;
    }
    if (scwin.lfn_check_pass()) {

        //SOBJ_Save.WSDL = gds.gWsdlBasis; //기본 웹서비스
        //DsWs_Warning.DataObject = "DOBJ_Save";
        //var MethodObj = SOBJ_Save.CreateMethodObj("perform");
        //setHeader("hashtable", "com.inswave.longterm.ssr.sst.task.DBB170Task", "setRqst");
        var MethodObj = new callService("com.inswave.longterm.ssr.sst.task.DBB170Task", "setRqst");
		MethodObj.setId("setRqst");

        Ds_LTIDA14.setCellData(0, "sPlanNo", parent.medt_PlanNo.getValue()); //설계번호	
        Ds_LTIDA14.setCellData(0, "sPlanProgRankCd", rqstFlag); //상태구분	
        Ds_LTIDA14.setCellData(0, "sConuResltCd", rdo_ConuResult.getValue()); //승인구분
        util.insertColumn(Ds_LTIDA14, [ [ "gUserID",    "gUserID",          "text"      ]   ]);
        util.insertColumn(Ds_LTIDA14, [ [ "gUserIP",    "gUserIP",           "text"      ]   ]);
        util.insertColumn(Ds_LTIDA14, [ [ "nCrChngNo","nCrChngNo",    "text"      ]   ]);
        Ds_LTIDA14.setCellData(0, "gUserID", util.getGdsValue("gUserID"));
        Ds_LTIDA14.setCellData(0, "gUserIP", util.getGdsValue("gUserIP"));
        Ds_LTIDA14.setCellData(0, "nCrChngNo", Ds_LTIDA00.getCellData(0, "nCrChngNo"));
        MethodObj.addSingleData("LTIDA14", "LTIDA14", "Ds_LTIDA14");//, "LTIDA14"); // 인수품의정보	
        //trace(DsWs_LTIDA14.SaveXML());
        //진단대상일때 진단대상인 피보험자 순번 
        if (rdo_ConuResult.getValue() == "04") {
            Ds_DgnsObjt.removeAll();//ClearData();
            for (var i = 0; i < Ds_LTIDA15.getRowCount(); i++) {
                var hasSeq = false;
                for (var j = 0; j < Ds_DgnsObjt.getRowCount(); j++) {
                    if (Ds_LTIDA15.getCellData(i, "nInrpsSeqno") == Ds_DgnsObjt.getCellData(j, "nInrpsSeqno")) {
                        hasSeq = true;
                    }
                }
                if (hasSeq == false) {
                    Ds_DgnsObjt.InsertRow(0);
                    Ds_DgnsObjt.setCellData(0, "nInrpsSeqno", Ds_LTIDA15.getCellData(i, "nInrpsSeqno"));
                }
            }

            //	trace("Ds_DgnsObjt:" + Ds_DgnsObjt.SaveXML());
            MethodObj.addVectorData("DgnsObjt", "DgnsObjt", "Ds_DgnsObjt");
        }
        //setTail("hashtable");
        //SOBJ_Save.CreateObj("in0");
        //MethodObj.in0 = insertStr;
        //var result = gfn_CallService(SOBJ_Save, DOBJ_Save, MethodObj);
		MethodObj.setUrl("/contract/CBSC159SController.do");  	// 서버단 호출 URL (수납 확정)    
		MethodObj.addXPath("//WARNING");	// XPath
		MethodObj.setHashTable();   	//  전문의 앞이 hashtable로 보낼 때
		MethodObj.sync();					// 동기 처리[기본(async:비동기)]
		MethodObj.send(); 					// 최종 전송 		// TEST @@@ ===>
		util.jSonDsCreate(_tranSync.getDsJson("WARNING"), "DsWs_Warning");

        if (DsWs_Warning.getRowCount() != 0) {
            wprom.alert(DsWs_Warning.getCellData(0, "msg"));
            return;
        } else {
            if (Ds_LTIDA14.getRowCount() > 0) {
                wprom.alert("인수승인처리 되었습니다.");
                if (wconv.substr(parent.medt_PlanNo.getValue(), 0, 1) != "N") {
                    //alert("카카오톡 발송 호출");
                    scwin.sendKakaoTalk();
                }

                var returnMsg = rqstFlag + "^" + rqstFlagName + "^" + wconv.toString(Ds_LTIDA15.getRowCount());

                //O210_Pop1.close(returnMsg);
                parent.scwin.lfn_OnClose(returnMsg);
            }
        }
    }
};
