/****************************************************************************
 * function 명 : setBuldgStrt
 * 내용        : 건물구조 setting
 ****************************************************************************/
scwin.setBuldgStrt = function() {
    //최초 건물구조		 
//alert(" setBuldgStrt ");    
    if (wconv.length(Ds_LTIDA60_detail.getCellData(0, "sBuldgStrtGradCd")) > 0) {
        var nPoleTypeCdIdx = wconv.findRow(DsWs_PoleTypeCd, "sCd", Ds_LTIDA60_detail.getCellData(0, "sPoleTypeCd"));
        var nExtrnWlTypeCdIdx = wconv.findRow(DsWs_ExtrnWlTypeCd, "sCd", Ds_LTIDA60_detail.getCellData(0, "sExtrnWlTypeCd"));
        var nRoofTypeCdIdx = wconv.findRow(DsWs_RoofTypeCd, "sCd", Ds_LTIDA60_detail.getCellData(0, "sRoofTypeCd"));
//alert(   nPoleTypeCdIdx +":"+ nExtrnWlTypeCdIdx+":"+   nRoofTypeCdIdx); 
        edt_sBuldgStrt.setValue(DsWs_PoleTypeCd.getCellData(nPoleTypeCdIdx, "sHnglCdName") + " / " 
                                      + DsWs_ExtrnWlTypeCd.getCellData(nExtrnWlTypeCdIdx, "sHnglCdName") + " / " 
                                      + DsWs_RoofTypeCd.getCellData(nRoofTypeCdIdx, "sHnglCdName"));
    } else {
        edt_sBuldgStrt.setValue("");
    }
console.log("★★★★ 4 ");    
};
/****************************************************************************
