scwin.lfn_searchObjLctn = function() {
    wconv.clear(DsWs_ObjLctn);
    /*orign
    SOBJ_ObjLctn.WSDL = gds.gWsdlBasis;
    var MethodObj = gfn_CreateMethodObj(SOBJ_ObjLctn, "com.inswave.longterm.ssr.pln.task.DBB030Task", "getObjctLctnList", "", "");
