    var result = gfn_CallService(SOBJ_ObjLctn, DOBJ_ObjLctn, MethodObj);
    */
   	var MethodObj = new callService("com.inswave.longterm.ssr.pln.task.DBB030Task", "getObjctLctnList");
	MethodObj.setId("getObjctLctnList");
	MethodObj.setParam("sPlanNo",parent.Ds_LTIDA00.getCellData(0, "sPlanNo")); // 설계/계약 번호
	MethodObj.setUrl("/contract/CBSC159SController.do");
	MethodObj.setXPath("//*/WARNING");
	//MethodObj.addXPath("//WARNING");
	MethodObj.sync();
	MethodObj.send();

	util.interfaceKey(_tranSync.result.serviceDs);
	DsWs_Warning.setJSON (_tranSync.getDsJson("LTIDA61")); // dataset 데이터

    if (result == false) {
        wprom.alert(DsWs_Warning.getCellData(0, "msg"));
        return;
    }
    if (DsWs_ObjLctn.getTotalRow() > 0) {
        if (DsWs_ObjLctn.getTotalRow() == Ds_LTIDA60.getTotalRow()) {
            Ds_ObjLctn.removeAll();
            wconv.copy(Ds_ObjLctn, "DsWs_ObjLctn");
            //wconv.trace("1======" + wconv.saveXml(Ds_ObjLctn));
        } else {
            for (var i = 0; i < Ds_LTIDA60.getTotalRow(); i++) {
                if (Ds_LTIDA60.getCellData(i, "nInsrdObjctSeqno") == DsWs_ObjLctn.getCellData(i, "nInsrdObjctSeqno")) {
                    util.deleteRow(Ds_ObjLctn, i);
                    util.appendRow(Ds_ObjLctn);
                    wconv.mi_copyRow(Ds_ObjLctn, i, "DsWs_ObjLctn", i);
                    //wconv.trace("2======" + wconv.saveXml(Ds_ObjLctn));
                } else {
                    util.appendRow(Ds_ObjLctn);
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "sPlanNo", Ds_LTIDA00.getCellData(0, "sPlanNo"));
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "nInsrdObjctSeqno", Ds_LTIDA60_detail.getCellData(i, "nInsrdObjctSeqno"));
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "nLctnSeqno", 1);
                    //wconv.trace("3======" + wconv.saveXml(Ds_ObjLctn));
                }
            }
        }
    } else {
        if (Ds_ObjLctn.getTotalRow() != DsWs_ObjLctn.getTotalRow()) {
            for (var i = 0; i < Ds_LTIDA60.getTotalRow(); i++) {
                if (Ds_LTIDA60.getCellData(i, "nInsrdObjctSeqno") == Ds_ObjLctn.getCellData(i, "nInsrdObjctSeqno")) {
                    wconv.trace("4======" + wconv.saveXml(Ds_ObjLctn));
                } else {
                    util.appendRow(Ds_ObjLctn);
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "sPlanNo", Ds_LTIDA00.getCellData(0, "sPlanNo"));
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "nInsrdObjctSeqno", Ds_LTIDA60_detail.getCellData(i, "nInsrdObjctSeqno"));
                    Ds_ObjLctn.setCellData(Ds_ObjLctn.getRowPosition(), "nLctnSeqno", 1);
                    wconv.trace("5======" + wconv.saveXml(Ds_ObjLctn));
                }
            }
        }
    }
};
/****************************************************************************
 * function 명 : lfn_Check_Validation
 * 내용        : 필수 입렵 체크
 * 전환
 ****************************************************************************/
scwin.lfn_Check_Validation = function() {
    var bResult = true;
    var sBunsMetdDocuClsfCd = parent.Ds_LTIDA00.getCellData(0, "sBunsMetdDocuClsfCd");
    var sBunsMetdClsfCd = parent.Ds_LTIDA00.getCellData(0, "sBunsMetdClsfCd");

    if (sBunsMetdDocuClsfCd != "3" && sBunsMetdClsfCd != "1") {
        wprom.alert("인보험Tap에서 인수승인 가능합니다.");
        return false;
    } else if (txa_approval.getValue() == "" || txa_approval.getValue() == null) {
        wprom.alert("승인자의견을 입력하여 주십시요");
        return  false;
    } else if (rdo_ConuResult.getValue() == "11" || util.isNull(rdo_ConuResult.getValue())) {
        wprom.alert("승인여부를 입력하여 주십시요");
        return  false;
    } else if (rdo_ConuResult.getValue() == "03" && util.isNull(cmb_UdrtkRjResn.getValue()) || 
                rdo_ConuResult.getValue() == "03" && util.isNull(cmb_UdrtkRjResn.getValue()) ) {
        wprom.alert("거절사유를 선택하여 주십시오.");
        return  false;
    }
    return bResult;
};

//---------------------------------------------------------------------------
// function 명 : lfn_check_pass
// 내용        : Editing / 비밀번호 체크 
// 전환
//---------------------------------------------------------------------------
scwin.lfn_check_pass = function() {
    var flag_login = false;
    if (edt_userPwd.getValue() == "") {
        flag_login = false;
        wprom.alertF("비밀번호 를 입력하세요.",{},edt_userPwd);
        //edt_userPwd.focus();
        return; //break;
    }
    /*orign
    SOBJ_LOGIN.WSDL = gds.gWsdlAdmin;
    var MethodObj = gfn_CreateMethodObj(SOBJ_LOGIN, "com.inswave.admin.task.LoginTask", "checkApprovalPwd", "", "");
   //gfn_SetParam(MethodObj, "sEmpNo"   , "5140021");
    gfn_SetParam(MethodObj, "sEmpNo", util.getGdsValue("gUserID"));
    gfn_SetParam(MethodObj, "sPassword", edt_userPwd.getValue());
    gfn_CallService(SOBJ_LOGIN, DOBJ_LOGIN, MethodObj);
    */
	var MethodObj = new callService("com.inswave.admin.task.LoginTask", "checkApprovalPwd");
	MethodObj.setId("checkApprovalPwd");
    MethodObj.setParam("sEmpNo", util.getGdsValue("gUserID"));
    MethodObj.setParam("sPassword", edt_userPwd.getValue());
	MethodObj.setUrl("/contract/CBSC159SController.do");
	MethodObj.setXPath("//*/PWD");
	MethodObj.addXPath("//WARNING");
	MethodObj.sync();
	MethodObj.send();

	//util.interfaceKey(_tranSync.result.serviceDs);
	//DsWs_Login.setJSON (_tranSync.getDsJson("PWD")); // dataset 데이터
	util.jSonDsCreate(_tranSync.getDsJson("PWD"), "DsWs_Login");
	util.jSonDsCreate(_tranSync.getDsJson("WARNING"), "WARNING");
	util.setRowPosition(DsWs_Login, 0);

    if (DsWs_Login.getCellData(0, "sPass") == "Y") {
        edt_userPwd.setValue("");
        flag_login = true;
    } else {
        edt_userPwd.setValue("");
        wprom.alertF("비밀번호가 틀렸습니다.",{},edt_userPwd);
        //edt_userPwd.focus();
        return; //break;
    }
    return flag_login;
};

